import { FormControl, InputLabel, makeStyles, MenuItem, Select, TextField } from '@material-ui/core'
import React from 'react'

const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));
const ComposeTeam = () => {
    const classes = useStyles();
    const [age, setAge] = React.useState('');

    const handleChange = (event) => {
        setAge(event.target.value);
    };

    return (
        <div>
            <TextField id="standard-basic" label="First Name" />
            <br></br>
            <TextField id="standard-basic" label="Last Name" />
            <br></br>
            <TextField id="standard-basic" label="Height" />
            <br></br>
            <FormControl className={classes.formControl}>
                <InputLabel id="demo-simple-select-label">Position</InputLabel>
                <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={age}
                    onChange={handleChange}
                >
                    <MenuItem value={10}>Point Guard (PG)</MenuItem>
                    <MenuItem value={20}>Shooting Guard (SG)</MenuItem>
                    <MenuItem value={30}>Small Forward (SF)</MenuItem>
                    <MenuItem value={30}>Power Forward (PF)</MenuItem>
                    <MenuItem value="Center (C)">Center (C)</MenuItem>
                </Select>
            </FormControl>
        </div>
    )
}

export default ComposeTeam
